import React from 'react';
import './App.css';
import MWFLogo from './MWF.svg';
import { Button, Tooltip } from 'carbon-components-react';
import 'carbon-components/css/carbon-components.min.css';

function App() {
  function handleClick(e) {
    e.preventDefault();
    console.log('CLICKED');
  }

  return (
    <div className="Manager">
      <header className="Manage-header">
        <img src={MWFLogo} height="350" width="600" />
        <div className="MainMenu" >
          <Button
            className="Menu"
            kind='primary'
            onClick={this.handleClick()}
            >
            Menu
          </Button>
          &nbsp;
          <Button
            className="Employee"
            kind='primary'
            >
            Employee
          </Button>
          </div>
          <div className="MainMenu">
          <Button
            className="Status"
            kind='primary'>
            Status
          </Button>
          &nbsp;
          <Button
            className="Inventory"
            kind='primary'>
            Inventory
          </Button>
          </div>
          <div className="MainMenu">
          <Button
            className="Survey"
            kind='primary'>
            Survey
          </Button>
          &nbsp;
          <Button
            className="Report"
            kind='primary'>
             Report
          </Button>
          </div>


      </header>
    </div>
  );
}

export default App;
